(24, 'portfolio/2a4f9755820fcefc35bd00768574e304.webp', 'portfolio/aa62815704501c87dae7394581422a4b.webp', 'Real Estate App', 'Discover a simpler way to navigate real estate with our mobile app, designed to streamline the buying, selling, and renting process. Our app combines detailed property listings, a convenient mortgage calculator, and map integration into a user-friendly interface that makes real estate decisions easier and more accessible. Explore the features that set us apart and enhance your property search experience.', 'Search Properties', 'Property Information', 'Map Integration', 'Payment Gateways', 'Mobile', 0, NULL, 'case-studies/real-estate-app', NULL, 16, 17, 1, '2024-06-03 14:36:02', '2024-07-30 14:23:44'),
