(26, 'portfolio/e54f8cf3254e38f44180aecc842ec9f5.webp', 'portfolio/1258c9448b2d92a3d019c9c857e1ee13.webp', 'Loyalty App', 'Discover a new level of shopping with Bonus Buddy. Enjoy exclusive cashback rewards, personalized deals, and a seamless experience across your favorite e-commerce platforms. Our intuitive app ensures you never miss out on the best offers tailored just for you, making your shopping journey more enjoyable and efficient. Easily track your rewards and savings in real-time, browse curated recommendations that match your preferences, and unlock special bonuses with every purchase. Share your favorite finds with friends and join a community of savvy shoppers who value smart spending and great deals. Shop smarter, save more, and make every purchase rewarding. Welcome to a superior shopping journey with Bonus Buddy, where your loyalty is always appreciated and rewarded!', 'Promotional Offers', 'Rewards', 'Discounts', 'Earn & Redeem Points', 'Mobile', 0, NULL, 'case-studies/loyalty-app', NULL, 12, 13, 1, '2024-06-24 15:36:47', '2024-07-30 14:23:31'),
