(29, 'portfolio/8713aea6c424c0afffb6278e43dfab15.webp', 'portfolio/68ac3aae04ae4aa9e21833d7922d4df2.webp', 'Gym Web', 'Gymnasium emerges as the definitive application dedicated to offering a comprehensive guide for enhancing physical health and overall well-being. This platform excels by integrating innovative tools and expert insights designed to empower users on their journey toward optimal fitness and wellness. Engage with Gymnasium to transform your health through structured guidance and supportive community features. Whether you\'re starting your fitness journey or aiming to reach new goals, Gymnasium provides the tools and support you need to succeed. From personalized workout plans to expert nutritional advice and real-time progress tracking, it\'s your all-in-one companion for achieving and maintaining a healthier lifestyle.', 'Content Management', 'User Management', 'Promotions', 'Bookings Management', 'Web', 1, NULL, 'case-studies/gym-web', NULL, 6, 7, 1, '2024-07-04 04:02:37', '2024-07-30 14:23:08'),
(30, 'portfolio/a3e73e5a1ca266a367d9f888156610fd.webp', 'portfolio/16cb744f819ed9f6b159c347c780e015.webp', 'Mover App', 'Develop a comprehensive mobile application designed to optimize the moving experience by facilitating efficient order management and customer engagement. The app aims to provide seamless real-time tracking of movers, an intuitive interface for profile customization, and direct feedback channels to improve service quality. Additionally, it seeks to incorporate membership and subscription features to offer value-added services and promotions, thereby enhancing customer loyalty and operational transparency in the moving industry.', 'Order Management', 'Track Order', 'Membership & Subscription', 'Nearby Courier', 'Mobile', 1, NULL, 'case-studies/mover-app', NULL, 4, 5, 1, '2024-07-04 04:05:18', '2024-07-30 14:23:02'),
